package com.Tan.FightWithMorra.bean;

public class Point {
	private double x;
	private double y;
	public double getX() {
		return x;
	}
	public void setX(double x) {
		this.x = x;
	}
	public double getY() {
		return y;
	}
	public void setY(double y) {
		this.y = y;
	}
	
	public Point(double x,double y) {
		super();
		// TODO Auto-generated constructor stub
		this.setX(x);
		this.setY(y);
	}
	
	
}
